import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

      </header>
      <form method="post" id= "hogehoge"action="https://2zgjwxifo3.execute-api.ap-northeast-1.amazonaws.com/default" encType="multipart/form-data" onClick={showLog()}>        
        <p>ファイル:
        <input type="file" name="file1" size="30"/>
        <input type="file" name="file2" size="30"/></p>

        <p><input type="submit" value="送信する"/></p>        
      </form>
    </div>
  );
}
function showLog(){
  console.log()
}

export default App;
